// export default Home;
const Home = () => {
  const { posts, getPosts } = useHome();

  useEffect(() => {
    getPosts();
  }, [getPosts]);

  console.log("posts", posts);

  return (
    <div>
      {posts.map((item) => (
        <li>
          <div>{item.id}</div>
          <div>{item.title}</div>
          <div>{item.body}</div>
        </li>
      ))}
    </div>
  );
};

export default Home;
